const LastName=createContext();
const App = () =>{
   return(
       <>
       <FirstName.Provider value={"Revati"}> 
       <LastName.Provider>
       <CompA/>
       </LastName.Provider>
       </FirstName.Provider>
       </>
   )
}
export default App
